import React from 'react';

const Pagination2 = (props) => {

    return (
        <div>
            <h2>Pagination</h2>
            <nav>
                <ul className="pagination">
                    <li className="page-item"><a  className="page-link">1</a></li>
                </ul>
            </nav>
        </div>
    );
};

export default Pagination2;
